@straydogfeedermalad ğŸ™HUSKY, aka McQueen, was an abandoned #husky that we #rescued in January of 2020. She was in a dire condition, as she was run over by a truck which temporarily paralyzed her.  We witnessed the accident and then saw that she was not able to get up; her hind legs were severely injured.  They seemed to be broken when my family and I picked her up and rushed her to a nearby hospital.  HUSKY was given basic intravenous saline solutions and first aid. Due to a lack of space at the hospital, we decided to take her to our home in #malad We immediately bought a 42-inch cage for her to rest inside. We also fed her very nutritious food during the course of her stay at our loving and nurturing home.  On the very next day, we also took her to a private veterinarian who gave her more saline, deworming medication, and other oral medications.  Once she was fed good food and cared for, she gained #strength and then started to walk again. Slowly and steadily, she became cheerful and began to play with my other dogs as well.  She even started to climb staircases and run alongside me during our daily walks. We also gave her a RABIES vaccine.  We are grateful for the well-wisher who gifted her a beautiful bed on which HUSKY slept comfortably.
Because of her advanced age and trauma before I RESCUED her, she succumbed to kidney failure.  We are very #thankful to each and every person who helped us with treatment expenses and to those who prayed for her continued good health. 
